    <script type="text/javascript">
        $(function (){
            $('[rel="editarUsuario"]').on('click', function () {
                var user_id = $(this).data('id');

                $.ajax({
                    type: "GET",
                    url: '{{ route('config.user', '_user_') }}'.replace('_user_', user_id),
                    dataType: 'html',
                    success: function (response) {
                        $('#verUsuario').modal('show');
                        $('#verUsuario .modal-content').html(response)
                    },
                });
            });

            $('[rel="convidarUsuario"]').on('click', function () {
                alert('oi');
            });
        });


    </script>

